import React from "react";

function Row({}) {
  const data = [];
  for (let i = 0; i < props.length; i++) {
    data.push(<td>{props[i]}</td>);
  }

  return <tr>{{ data }}</tr>;
}

Row.defaultProps = {
  name: "no-name",
};

export default Row;
